define({"topics" : [{"title":"Origins","shortdesc":"\n            <p class=\"shortdesc\">An origin stage represents the source for the pipeline. You can use a single origin     stage in a pipeline.</p>\n         ","id":"concept_hpr_twm_jq","href":"datacollector\/UserGuide\/Origins\/Origins_overview.html#concept_hpr_twm_jq","menu": {"hasChildren":true,},"tocID":"concept_hpr_twm_jq-d46e23821","next":"concept_hpr_twm_jq-d46e23821",},{"title":"Amazon S3","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_kvs_3hh_ht","href":"datacollector\/UserGuide\/Origins\/AmazonS3.html#concept_kvs_3hh_ht","menu": {"hasChildren":true,},"tocID":"concept_kvs_3hh_ht-d46e24391","next":"concept_kvs_3hh_ht-d46e24391",},{"title":"Amazon SQS Consumer","id":"concept_xsh_knm_5bb","href":"datacollector\/UserGuide\/Origins\/AmazonSQS.html#concept_xsh_knm_5bb","menu": {"hasChildren":true,},"tocID":"concept_xsh_knm_5bb-d46e25333","next":"concept_xsh_knm_5bb-d46e25333",},{"title":"Azure IoT\/Event Hub Consumer","id":"concept_c1z_15q_1bb","href":"datacollector\/UserGuide\/Origins\/AzureEventHub.html#concept_c1z_15q_1bb","menu": {"hasChildren":true,},"tocID":"concept_c1z_15q_1bb-d46e25797","next":"concept_c1z_15q_1bb-d46e25797",},{"title":"CoAP Server","shortdesc":"\n            <p class=\"shortdesc\">Constrained Application Protocol (CoAP) is a web transfer protocol designed for         machine-to-machine devices. The CoAP\n               Server origin is a multithreaded origin that listens on         a CoAP endpoint and processes the contents of all authorized\n               CoAP requests. \n            </p>\n         ","id":"concept_wfy_ghn_sz","href":"datacollector\/UserGuide\/Origins\/CoAPServer.html#concept_wfy_ghn_sz","menu": {"hasChildren":true,},"tocID":"concept_wfy_ghn_sz-d46e26079","next":"concept_wfy_ghn_sz-d46e26079",},{"title":"Directory","shortdesc":"\n            <p class=\"shortdesc\">The Directory origin reads data from files in a directory. The origin can use         multiple threads to enable the parallel\n               processing of files. \n            </p>\n         ","id":"concept_qcq_54n_jq","href":"datacollector\/UserGuide\/Origins\/Directory.html#concept_qcq_54n_jq","menu": {"hasChildren":true,},"tocID":"concept_qcq_54n_jq-d46e26374","next":"concept_qcq_54n_jq-d46e26374",},{"title":"Elasticsearch ","shortdesc":"\n            <p class=\"shortdesc\">The Elasticsearch origin is a multithreaded origin that reads data from an Elasticsearch         cluster, including Elastic\n               Cloud clusters (formerly Found clusters). The origin generates a         record for each Elasticsearch document.\n            </p>\n         ","id":"concept_f1q_vpm_2z","href":"datacollector\/UserGuide\/Origins\/Elasticsearch.html#concept_f1q_vpm_2z","menu": {"hasChildren":true,},"tocID":"concept_f1q_vpm_2z-d46e27646","next":"concept_f1q_vpm_2z-d46e27646",},{"title":"File Tail","shortdesc":"\n            <p class=\"shortdesc\">The File Tail origin reads lines of data as they are written to an active file after         reading related archived files\n               in the same directory. File Tail generates a record for each         line of data.\n            </p>\n         ","id":"concept_n1y_qyp_5q","href":"datacollector\/UserGuide\/Origins\/FileTail.html#concept_n1y_qyp_5q","menu": {"hasChildren":true,},"tocID":"concept_n1y_qyp_5q-d46e28030","next":"concept_n1y_qyp_5q-d46e28030",},{"title":"Google BigQuery","shortdesc":"\n            <p class=\"shortdesc\">The Google BigQuery origin executes a query job and reads the result from Google         BigQuery. </p>\n         ","id":"concept_cg3_y3v_q1b","href":"datacollector\/UserGuide\/Origins\/BigQuery.html#concept_cg3_y3v_q1b","menu": {"hasChildren":true,},"tocID":"concept_cg3_y3v_q1b-d46e29279","next":"concept_cg3_y3v_q1b-d46e29279",},{"title":"Google Cloud Storage","id":"concept_iyd_wql_nbb","href":"datacollector\/UserGuide\/Origins\/GCS.html#concept_iyd_wql_nbb","menu": {"hasChildren":true,},"tocID":"concept_iyd_wql_nbb-d46e29749","next":"concept_iyd_wql_nbb-d46e29749",},{"title":"Google Pub\/Sub Subscriber","shortdesc":"\n            <p class=\"shortdesc\">The Google Pub\/Sub Subscriber origin consumes messages from a Google Pub\/Sub         subscription. </p>\n         ","id":"concept_pjw_qtl_r1b","href":"datacollector\/UserGuide\/Origins\/PubSub.html#concept_pjw_qtl_r1b","menu": {"hasChildren":true,},"tocID":"concept_pjw_qtl_r1b-d46e30311","next":"concept_pjw_qtl_r1b-d46e30311",},{"title":"Hadoop FS","shortdesc":"\n            <p class=\"shortdesc\">The Hadoop FS origin reads data from the Hadoop Distributed File System (HDFS) or from     other file systems using the Hadoop\n               FileSystem interface. \n            </p>\n         ","id":"concept_lw2_tnm_vs","href":"datacollector\/UserGuide\/Origins\/HadoopFS-origin.html#concept_lw2_tnm_vs","menu": {"hasChildren":true,},"tocID":"concept_lw2_tnm_vs-d46e30781","next":"concept_lw2_tnm_vs-d46e30781",},{"title":"Hadoop FS Standalone","shortdesc":"\n            <p class=\"shortdesc\">The Hadoop FS Standalone origin reads files in HDFS. The origin can use multiple         threads to enable the parallel processing\n               of files. The files to be processed must all share         a file name pattern and be fully written. You can also configure\n               the origin to read from         Azure HDInsight.\n            </p>\n         ","id":"concept_djz_pdm_hdb","href":"datacollector\/UserGuide\/Origins\/HDFSStandalone.html#concept_djz_pdm_hdb","menu": {"hasChildren":true,},"tocID":"concept_djz_pdm_hdb-d46e31251","next":"concept_djz_pdm_hdb-d46e31251",},{"title":"HTTP Client","id":"concept_wk4_bjz_5r","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_wk4_bjz_5r","menu": {"hasChildren":true,},"tocID":"concept_wk4_bjz_5r-d46e33040","next":"concept_wk4_bjz_5r-d46e33040",},{"title":"HTTP Server","shortdesc":"\n            <p class=\"shortdesc\">The HTTP Server origin is a multithreaded origin that listens on an HTTP endpoint and         processes the contents of all\n               authorized HTTP POST and PUT requests. Use the HTTP Server         origin to read high volumes of HTTP POST and PUT requests\n               using multiple threads. \n            </p>\n         ","id":"concept_s2p_5hb_4y","href":"datacollector\/UserGuide\/Origins\/HTTPServer.html#concept_s2p_5hb_4y","menu": {"hasChildren":true,},"tocID":"concept_s2p_5hb_4y-d46e35432","next":"concept_s2p_5hb_4y-d46e35432",},{"title":"HTTP to Kafka (Deprecated)","id":"concept_izh_mqd_dy","href":"datacollector\/UserGuide\/Origins\/HTTPtoKafka.html#concept_izh_mqd_dy","menu": {"hasChildren":true,},"tocID":"concept_izh_mqd_dy-d46e35899","next":"concept_izh_mqd_dy-d46e35899",},{"title":"JDBC Multitable Consumer","id":"concept_zp3_wnw_4y","href":"datacollector\/UserGuide\/Origins\/MultiTableJDBCConsumer.html#concept_zp3_wnw_4y","menu": {"hasChildren":true,},"tocID":"concept_zp3_wnw_4y-d46e36460","next":"concept_zp3_wnw_4y-d46e36460",},{"title":"JDBC Query Consumer","id":"concept_qhf_hjr_bs","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_qhf_hjr_bs","menu": {"hasChildren":true,},"tocID":"concept_qhf_hjr_bs-d46e40326","next":"concept_qhf_hjr_bs-d46e40326",},{"title":"JMS Consumer","shortdesc":"\n            <p class=\"shortdesc\">The JMS Consumer origin reads data from a Java Messaging Service (JMS). </p>\n         ","id":"concept_rhh_4nj_dt","href":"datacollector\/UserGuide\/Origins\/JMS.html#concept_rhh_4nj_dt","menu": {"hasChildren":true,},"tocID":"concept_rhh_4nj_dt-d46e42088","next":"concept_rhh_4nj_dt-d46e42088",},{"title":"Kafka Consumer","id":"concept_msz_wnr_5q","href":"datacollector\/UserGuide\/Origins\/KConsumer.html#concept_msz_wnr_5q","menu": {"hasChildren":true,},"tocID":"concept_msz_wnr_5q-d46e42463","next":"concept_msz_wnr_5q-d46e42463",},{"title":"Kafka Multitopic Consumer","id":"concept_ccs_fn4_x1b","href":"datacollector\/UserGuide\/Origins\/KafkaMultiConsumer.html#concept_ccs_fn4_x1b","menu": {"hasChildren":true,},"tocID":"concept_ccs_fn4_x1b-d46e43272","next":"concept_ccs_fn4_x1b-d46e43272",},{"title":"Kinesis Consumer","shortdesc":"\n            <p class=\"shortdesc\">The Kinesis Consumer origin reads data from Amazon Kinesis Streams. </p>\n         ","id":"concept_anh_4y3_yr","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_anh_4y3_yr","menu": {"hasChildren":true,},"tocID":"concept_anh_4y3_yr-d46e44212","next":"concept_anh_4y3_yr-d46e44212",},{"title":"MapR DB CDC","id":"concept_qwj_5vm_pbb","href":"datacollector\/UserGuide\/Origins\/MapRdbCDC.html#concept_qwj_5vm_pbb","menu": {"hasChildren":true,},"tocID":"concept_qwj_5vm_pbb-d46e44685","next":"concept_qwj_5vm_pbb-d46e44685",},{"title":"MapR DB JSON","shortdesc":"\n            <p class=\"shortdesc\">The MapR DB JSON origin reads JSON documents from MapR DB JSON tables. The origin         converts each document into a record.</p>\n         ","id":"concept_ywh_k15_3y","href":"datacollector\/UserGuide\/Origins\/MapRDBJSON.html#concept_ywh_k15_3y","menu": {"hasChildren":true,},"tocID":"concept_ywh_k15_3y-d46e44967","next":"concept_ywh_k15_3y-d46e44967",},{"title":"MapR FS","shortdesc":"\n            <p class=\"shortdesc\">The MapR FS origin reads files from MapR FS. Use this origin only in pipelines         configured for cluster batch pipeline\n               execution mode. \n            </p>\n         ","id":"concept_psz_db4_lx","href":"datacollector\/UserGuide\/Origins\/MapRFS.html#concept_psz_db4_lx","menu": {"hasChildren":true,},"tocID":"concept_psz_db4_lx-d46e45069","next":"concept_psz_db4_lx-d46e45069",},{"title":"MapR FS Standalone","shortdesc":"\n            <p class=\"shortdesc\">The MapR FS Standalone origin reads files in MapR. The origin can use multiple         threads to enable the parallel processing\n               of files. The files to be processed must all share         a file name pattern and be fully written. \n            </p>\n         ","id":"concept_b43_3qc_mdb","href":"datacollector\/UserGuide\/Origins\/MapRFSStandalone.html#concept_b43_3qc_mdb","menu": {"hasChildren":true,},"tocID":"concept_b43_3qc_mdb-d46e45455","next":"concept_b43_3qc_mdb-d46e45455",},{"title":"MapR Multitopic Streams Consumer","id":"concept_hvd_hww_lbb","href":"datacollector\/UserGuide\/Origins\/MapRStreamsMultiConsumer.html#concept_hvd_hww_lbb","menu": {"hasChildren":true,},"tocID":"concept_hvd_hww_lbb-d46e47068","next":"concept_hvd_hww_lbb-d46e47068",},{"title":"MapR Streams Consumer","shortdesc":"\n            <p class=\"shortdesc\">The MapR Streams Consumer origin reads messages from MapR Streams.</p>\n         ","id":"concept_cvy_xsf_2v","href":"datacollector\/UserGuide\/Origins\/MapRStreamsCons.html#concept_cvy_xsf_2v","menu": {"hasChildren":true,},"tocID":"concept_cvy_xsf_2v-d46e47529","next":"concept_cvy_xsf_2v-d46e47529",},{"title":"MongoDB","id":"concept_bk4_2rs_ns","href":"datacollector\/UserGuide\/Origins\/MongoDB.html#concept_bk4_2rs_ns","menu": {"hasChildren":true,},"tocID":"concept_bk4_2rs_ns-d46e47821","next":"concept_bk4_2rs_ns-d46e47821",},{"title":"MongoDB Oplog","id":"concept_mjn_yqw_4y","href":"datacollector\/UserGuide\/Origins\/MongoDBOplog.html#concept_mjn_yqw_4y","menu": {"hasChildren":true,},"tocID":"concept_mjn_yqw_4y-d46e48382","next":"concept_mjn_yqw_4y-d46e48382",},{"title":"MQTT Subscriber","shortdesc":"\n            <p class=\"shortdesc\">The MQTT Subscriber origin subscribes to topics on an MQTT broker to read messages         from the broker. The origin functions\n               as an MQTT client that receives messages, generating a         record for each message.\n            </p>\n         ","id":"concept_ukz_3vt_lz","href":"datacollector\/UserGuide\/Origins\/MQTTSubscriber.html#concept_ukz_3vt_lz","menu": {"hasChildren":true,},"tocID":"concept_ukz_3vt_lz-d46e48840","next":"concept_ukz_3vt_lz-d46e48840",},{"title":"MySQL Binary Log","id":"concept_kqg_1yh_xx","href":"datacollector\/UserGuide\/Origins\/MySQLBinaryLog.html#concept_kqg_1yh_xx","menu": {"hasChildren":true,},"tocID":"concept_kqg_1yh_xx-d46e49059","next":"concept_kqg_1yh_xx-d46e49059",},{"title":"Omniture","shortdesc":"\n            <p class=\"shortdesc\">The Omniture origin processes JSON website usage reports generated by the Omniture   reporting APIs. Omniture is also known\n               as the Adobe Marketing Cloud.\n            </p>\n         ","id":"concept_dsr_xmw_1s","href":"datacollector\/UserGuide\/Origins\/Omniture.html#concept_dsr_xmw_1s","menu": {"hasChildren":true,},"tocID":"concept_dsr_xmw_1s-d46e49630","next":"concept_dsr_xmw_1s-d46e49630",},{"title":"OPC UA Client ","id":"concept_nmf_1ly_f1b","href":"datacollector\/UserGuide\/Origins\/OPCUAClient.html#concept_nmf_1ly_f1b","menu": {"hasChildren":true,},"tocID":"concept_nmf_1ly_f1b-d46e49687","next":"concept_nmf_1ly_f1b-d46e49687",},{"title":"Oracle CDC Client","id":"concept_rs5_hjj_tw","href":"datacollector\/UserGuide\/Origins\/OracleCDC.html#concept_rs5_hjj_tw","menu": {"hasChildren":true,},"tocID":"concept_rs5_hjj_tw-d46e49899","next":"concept_rs5_hjj_tw-d46e49899",},{"title":"RabbitMQ Consumer","shortdesc":"\n            <p class=\"shortdesc\">RabbitMQ Consumer reads AMQP messages from a single RabbitMQ queue.</p>\n         ","id":"concept_dyg_lq1_h5","href":"datacollector\/UserGuide\/Origins\/RabbitMQ.html#concept_dyg_lq1_h5","menu": {"hasChildren":true,},"tocID":"concept_dyg_lq1_h5-d46e53477","next":"concept_dyg_lq1_h5-d46e53477",},{"title":"Redis Consumer","shortdesc":"\n            <p class=\"shortdesc\">The Redis Consumer origin reads messages from Redis. </p>\n         ","id":"concept_plr_t3v_jw","href":"datacollector\/UserGuide\/Origins\/Redis.html#concept_plr_t3v_jw","menu": {"hasChildren":true,},"tocID":"concept_plr_t3v_jw-d46e53697","next":"concept_plr_t3v_jw-d46e53697",},{"title":"Salesforce","id":"concept_odf_vr3_rx","href":"datacollector\/UserGuide\/Origins\/Salesforce.html#concept_odf_vr3_rx","menu": {"hasChildren":true,},"tocID":"concept_odf_vr3_rx-d46e53851","next":"concept_odf_vr3_rx-d46e53851",},{"title":"SDC RPC ","shortdesc":"\n            <p class=\"shortdesc\"> The SDC RPC origin enables connectivity between two SDC RPC pipelines. The SDC RPC     origin reads data passed from an SDC\n               RPC destination. Use the SDC RPC origin as part of an SDC     RPC destination pipeline.\n            </p>\n         ","id":"concept_agb_5c1_ct","href":"datacollector\/UserGuide\/Origins\/SDC_RPCorigin.html#concept_agb_5c1_ct","menu": {"hasChildren":true,},"tocID":"concept_agb_5c1_ct-d46e56449","next":"concept_agb_5c1_ct-d46e56449",},{"title":"SDC RPC to Kafka (Deprecated)","id":"concept_tdk_slk_pw","href":"datacollector\/UserGuide\/Origins\/SDCRPCtoKafka.html#concept_tdk_slk_pw","menu": {"hasChildren":true,},"tocID":"concept_tdk_slk_pw-d46e56506","next":"concept_tdk_slk_pw-d46e56506",},{"title":"SFTP\/FTP Client","shortdesc":"\n            <p class=\"shortdesc\">The SFTP\/FTP Client origin reads files from a server using the Secure File Transfer         Protocol (SFTP) or the File Transfer\n               Protocol (FTP). \n            </p>\n         ","id":"concept_ic5_bzd_5v","href":"datacollector\/UserGuide\/Origins\/SFTP.html#concept_ic5_bzd_5v","menu": {"hasChildren":true,},"tocID":"concept_ic5_bzd_5v-d46e57186","next":"concept_ic5_bzd_5v-d46e57186",},{"title":"SQL Server CDC Client","id":"concept_ut3_ywc_v1b","href":"datacollector\/UserGuide\/Origins\/SQLServerCDC.html#concept_ut3_ywc_v1b","menu": {"hasChildren":true,},"tocID":"concept_ut3_ywc_v1b-d46e57753","next":"concept_ut3_ywc_v1b-d46e57753",},{"title":"SQL Server Change Tracking","id":"concept_ewq_b2s_r1b","href":"datacollector\/UserGuide\/Origins\/SQLServerChange.html#concept_ewq_b2s_r1b","menu": {"hasChildren":true,},"tocID":"concept_ewq_b2s_r1b-d46e59147","next":"concept_ewq_b2s_r1b-d46e59147",},{"title":"TCP Server","id":"concept_ppm_xb1_4z","href":"datacollector\/UserGuide\/Origins\/TCPServer.html#concept_ppm_xb1_4z","menu": {"hasChildren":true,},"tocID":"concept_ppm_xb1_4z-d46e60225","next":"concept_ppm_xb1_4z-d46e60225",},{"title":"UDP Multithreaded Source","id":"concept_wng_g5f_5bb","href":"datacollector\/UserGuide\/Origins\/UDPMulti.html#concept_wng_g5f_5bb","menu": {"hasChildren":true,},"tocID":"concept_wng_g5f_5bb-d46e60683","next":"concept_wng_g5f_5bb-d46e60683",},{"title":"UDP Source","id":"concept_rst_2y5_1s","href":"datacollector\/UserGuide\/Origins\/UDP.html#concept_rst_2y5_1s","menu": {"hasChildren":true,},"tocID":"concept_rst_2y5_1s-d46e61048","next":"concept_rst_2y5_1s-d46e61048",},{"title":"UDP to Kafka (Deprecated)","id":"concept_jzq_jcz_pw","href":"datacollector\/UserGuide\/Origins\/UDPtoKafka.html#concept_jzq_jcz_pw","menu": {"hasChildren":true,},"tocID":"concept_jzq_jcz_pw-d46e61196","next":"concept_jzq_jcz_pw-d46e61196",},{"title":"WebSocket Client","shortdesc":"\n            <p class=\"shortdesc\">The WebSocket Client origin reads data from a WebSocket server endpoint. Use the origin         to read data from a WebSocket\n               resource URL. \n            </p>\n         ","id":"concept_unk_nzk_fbb","href":"datacollector\/UserGuide\/Origins\/WebSocketClient.html#concept_unk_nzk_fbb","menu": {"hasChildren":true,},"tocID":"concept_unk_nzk_fbb-d46e61657","next":"concept_unk_nzk_fbb-d46e61657",},{"title":"WebSocket Server","shortdesc":"\n            <p class=\"shortdesc\">The WebSocket Server origin is a multithreaded origin that listens on a WebSocket         endpoint and processes the contents\n               of all authorized WebSocket client requests. Use the         WebSocket Server origin to read high volumes of WebSocket client\n               requests using multiple         threads. \n            </p>\n         ","id":"concept_u2r_gpc_3z","href":"datacollector\/UserGuide\/Origins\/WebSocketServer.html#concept_u2r_gpc_3z","menu": {"hasChildren":true,},"tocID":"concept_u2r_gpc_3z-d46e61810","next":"concept_u2r_gpc_3z-d46e61810",},{"title":"Windows Event Log","shortdesc":"\n            <p class=\"shortdesc\">The Windows Event Log origin reads data from a Microsoft Windows event log located on a         Windows machine. The origin\n               generates a record for each event in the log. \n            </p>\n         ","id":"concept_agf_5jv_sbb","href":"datacollector\/UserGuide\/Origins\/WindowsLog.html#concept_agf_5jv_sbb","menu": {"hasChildren":true,},"tocID":"concept_agf_5jv_sbb-d46e62187","next":"concept_agf_5jv_sbb-d46e62187",}]});